'use strict';

var objectEntries = require( '@stdlib/utils/entries' );
var objectFromEntries = require( './../lib' );

var obj1 = {
	'beep': 'boop',
	'a': {
		'b': 'c'
	},
	'foo': [ 'bar' ]
};

var entries = objectEntries( obj1 );

console.log( entries );
// e.g., => [ ['beep', 'boop'], ['a', {'b':'c'}], ['foo', [ 'bar' ]] ]

var obj2 = objectFromEntries( entries );

console.dir( obj2 );
/* =>
	{
		'beep': 'boop',
		'a': {
			'b': 'c'
		},
		'foo': [ 'bar' ]
	}
*/

